INSERT DELAYED INTO `clube` (`idclube`, `nome_oficial`, `resumo`) VALUES
(1, 'http://dbpedia.org/resource/Baba_Diawara', 'O Club Sport Marítimo é um clube de futebol da ilha da Madeira, tendo cerca de 24000 sócios inscritos. A sua principal modalidade é o futebol, mas conta ainda com andebol, automobilismo, atletismo, basquetebol, futsal, hóquei em patins, patinagem, karaté, natação, pesca desportiva, tiro e voleibol. O Maior clube da ilha da madeira, fruto de uma maior mobilidade social, tem claramente a maioria da população da sua região como adepta. Um dos clubes mais históricos do campeonato português tem no futebol a sua maior e mais mediática modalidade, estando a sua história indubitavelmente ligada a este desporto.'),
(2, 'Rio Ave Futebol Clube', 'O Rio Ave Futebol Clube é um clube português de futebol, da cidade de Vila do Conde, que disputa actualmente a Liga Zon Sagres. Foi fundado em 18 de Janeiro de 1939. A sua casa é o Estádio dos Arcos, situado na cidade de Vila do Conde, ao lado do Pavilhão de Desportos.'),
(3, 'Sport Lisboa e Benfica', 'O Sport Lisboa e Benfica é um clube multidesportivo sediado em Lisboa. O seu eclectismo, historial e forte base de adeptos fazem do Benfica um dos maiores clubes de Portugal e um dos mais prestigiados a nível mundial, tal como os outros clubes portugueses pertencentes aos "três grandes". As estimativas em relação ao número de adeptos apontam para cerca de 14 milhões espalhados por todo o mundo. Segundo o Guiness, o Benfica é o clube do mundo com mais sócios activos, cerca de 160.000, na altura, atingindo agora os 230.000 sócios. Foi considerado pela IFFHS como o nono melhor clube do século XX. Além do futebol, este clube distingue-se também noutras modalidades (apresentadas no final do artigo). Utiliza como cores principais o vermelho e o branco e como símbolo uma águia, chamada Vitória. Conquistou o seu último título como campeão nacional de futebol na época de 2009/10 no dia 9 de Maio de 2010, no Estádio da Luz, frente ao Predefinição:PtRA (2-1) com golos de Óscar Cardozo que assim foi o melhor marcador daquela época. É, actualmente, o segundo clube com mais troféus de Portugal, atrás do FC Porto.'),
(4, 'Autónomo de Futebol', 'A Associação Académica de Coimbra – Organismo Autónomo de Futebol (AAC–OAF), normalmente apenas designada de Académica de Coimbra, é o clube de futebol profissional mais conhecido da cidade de Coimbra, Portugal. A Associação Académica de Coimbra foi fundada em 1887, e o Organismo Autónomo de Futebol, criado em 1984, sendo o mais antigo clube em Portugal a militar nas divisões profissionais. É hoje em dia presidido por José Eduardo Simões. A Académica é a detentora da 1ª Taça de Portugal, ganha em 1939.'),
(5, 'Sporting Clube de Portugal', 'O Sporting Clube de Portugal é um clube multi-desportivo português, fundado em 1906. Presente nas mais diversas modalidades é o clube português que mais títulos conquistou e o segundo com mais títulos na Europa, só ultrapassado pelo Barcelona, de Espanha. A nível mundial é o clube com mais medalhas e vitórias em competições olímpicas. Clube da capital, Lisboa, é um dos chamados "3 grandes de Portugal", destacando-se nas últimas duas décadas pelas suas escolas de formação em futebol, conseguindo ser o único clube do mundo a formar dois jogadores eleitos com o título de melhor jogador do mundo, Luís Figo e Cristiano Ronaldo. A equipa de futebol do Sporting Clube Portugal joga no Estádio José Alvalade, em Lisboa.'),
(6, 'Paços de Ferreira', 'O Futebol Clube Paços de Ferreira é um clube de futebol português, sediado em Paços de Ferreira.'),
(7, 'Futebol Clube do Porto', 'O Futebol Clube do Porto é um clube desportivo português fundado em 1893 da cidade do Porto. É o clube com maior número de títulos do futebol português, contabilizando 69 troféus, dos quais 7 internacionais. O principal rival Benfica possui 68 títulos, com "apenas" dois troféus internacionais. É o único clube português penta-campeão de futebol, duas vezes tetra-campeão e detentor de quatro triplas (1997-98, 2002-03, 2005-06 e 2008-09). Possui o deca-campeonato em hóquei em patins e é o clube de futebol europeu com mais títulos desde 1974/75. Se considerarmos todas as categorias de futebol (sénior, júnior e juvenil), o FC Porto é, novamente, quem mais títulos tem, com 124 troféus. É, ainda, o primeiro clube português a terminar o campeonato nacional sem derrotas no século XXI, feito que apenas tinha sido alcançado em 1972/1973 pelo Benfica. O Porto detém, ainda, o recorde de maior distância para o segundo classificado: 21 pontos para o Benfica em 2010/2011'),
(8, 'Sporting Clube de Braga', 'O Sporting Clube de Braga, frequentemente tratado por apenas Sporting de Braga, Braga ou pelo acrónimo SCB, é um clube desportivo fundado oficialmente em 19 de Janeiro em 1921 e sediado na cidade de Braga, em Portugal. Trata-se de um clube eclético que, para além do futebol, se distingue em modalidades como o atletismo e a natação, tendo já vencido vários troféus nacionais e internacionais. Actualmente milita na Primeira Liga de futebol. O Sporting de Braga é hoje um clube de referência nacional que disputa a hegemonia dos três principais clubes portugueses. O clube dispõe de um palmarés significativo que inclui a conquista da Taça de Portugal na época de 1966/67 e da Taça Federação Portuguesa de Futebol em 1976/77. Nas últimas épocas classificou-se repetidamente nos cinco primeiros postos do campeonato português, assegurando presença assídua na Taça UEFA com resultados meritórios. A conquista da Taça Intertoto em 2008, o segundo lugar no Campeonato em 2010, a presença inédita na edição 2010/11 da Liga dos Campeões e o segundo lugar na Liga Europa da UEFA de 2010-11, constituem-se como momentos ímpares da afirmação internacional do clube português que mais tem crescido nos últimos anos. O crescimento desportivo tem sido acompanhado pelo aumento significativo do número de sócios. Actualmente, o Braga conta com mais de 25.000 sócios que acompanham a equipa de forma especial. No final da época de 2009/10, quando o clube disputava o primeiro lugar do campeonato com o Benfica, vários milhares de adeptos acompanharam a equipa nas deslocações às cidades de Leiria e Figueira da Foz. Em casa, o jogo com mais adeptos foi a recepção ao Marítimo em 14 de Fevereiro de 2010 que contou com 30.184 espectadores nas bancadas do Estádio Axa. Tem como principal rival o Vitória de Guimarães, o seu "vizinho" de cidade com quem protagoniza o "Derby do Minho".');

